import styled from 'styled-components';

export const StyledManagePlayer = styled.div`
  
  background-color: #14346C;
  text-align: center;

  & h3 {
    color: white;
  }

  & .MuiList-root{
    color: white;
  }

  & .back {
    margin: 0 1em;
    color: black;
    background-color: #FFAD00;
  }

  & .save {
    margin: 1em 1em;
    color: #c1dcd6;
    background-color: #059234;
  }
`;
